import React, { Component } from 'react'
import history from '../history';
export default class Adminpanel extends Component {
    constructor(props){
        super(props);
        this.state = {
            username : this.props.location.state.username
        };
    }
    componentDidMount(){
        if(this.props.location.state === undefined){
            history.push('/admin');
        }
    }
    render() {
        return (
            <div>
                Adminpanel
            </div>
        )
    }
}
